                // Antes era 18+, ahora base 13. Mucho ms discreto.
                var iconSize = 13 + (zoom - 8) * 1.5;

                        // vel ser null en los bordes, as que no se dibuja nada fuera.
                        if (vel === null) continue;
                        
                        var lat = vData.lats[i];
                        var lon = vData.lons[j];
                        var dir = vData.dir[i][j];
                        
                        // SVG FINA TIPO PLUMA
                        var iconSvg = '<svg viewBox="0 0 24 24" width="' + iconSize + '" height="' + iconSize + '" ' +
                            'style="transform: rotate(' + (dir + 180) + 'deg); overflow:visible;">' +
                            '<path d="M12 20 L12 4" stroke="black" stroke-width="1.2" stroke-linecap="round" />' +
                            '<path d="M6 10 L12 4 L18 10" fill="none" stroke="black" stroke-width="1.2" stroke-linecap="round" stroke-linejoin="round" />' +
                            '</svg>';
                            
                        L.marker([lat, lon], {
                            icon: L.divIcon({
                                className: 'v-arrow',
                                html: iconSvg,
                                iconSize: [iconSize, iconSize],
                                iconAnchor: [iconSize/2, iconSize/2]
                            }),
                            interactive: false
                        }).addTo(vectorLayer);
                    }
                }
            }
            
            map.on('zoomend', dibujarVectores);
            dibujarVectores();
        }, 500);
